			shellScript = "\n# 设置 framework 名称\nFMK_NAME=\"statickframework\"\n\n# 合并后的 framework 将在此文件夹中生成\nLIBDIR=${SRCROOT}/Products/\nINSTALL_DIR=${LIBDIR}${FMK_NAME}.framework\n\n# framework 生成后，移除 build 文件夹\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/Debug-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${WRK_DIR}/Debug-iphonesimulator/${FMK_NAME}.framework\n\n# 编译模拟器和真机的 framework\nxcodebuild -configuration \"Debug\" \\\n    -target \"${FMK_NAME}\" \\\n    -sdk iphoneos\n\nxcodebuild -configuration \"Debug\" \\\n    -target \"${FMK_NAME}\" \\\n    -sdk iphonesimulator \\\n    ARCHS='i386 x86_64' \\\n    VALID_ARCHS='i386 x86_64'\n\n# 清理旧文件 创建新文件\nif [ -d \"${INSTALL_DIR}\" ]; then\n    rm -rf \"${INSTALL_DIR}\"\nfi\nmkdir -p \"${INSTALL_DIR}\"\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\ncp -R \"${SIMULATOR_DIR}/\" \"${INSTALL_DIR}/\"\n\n# 合并真机和模拟器的 framework\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\n# 移除 biuld 文件夹\nrm -r \"${WRK_DIR}\"\n\n# 打开 products 文件夹\nopen \"${LIBDIR}\"\n";
